import mouse from "./imgs/mouse.jpeg";
import auto from "./imgs/auto.jpeg";

const listaProductos = [
    {
        id: 1,
        nombre: "auto",
        imagen: auto,
        description: "Soy un auto xd"
    },
    {
        id: 2,
        nombre: "mouse",
        imagen: mouse,
        description: "Mouse Logitech"
    }
];

export default listaProductos;
